import React from 'react'
import Card from '../components/card'

export default function YourCards({ yourCards, checkCard }) {

    const renderYourCards = () => yourCards.map(yourCard => {
        return <Card card={ yourCard } checkCard={ checkCard } />
    })

    return (
        <div className="your-cards">
           {renderYourCards()}
        </div>
    )
}
